pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./Security.sol";
import "./SharedStructs.sol";


/*
    Error codes
    1: insufficient amount
    2: insufficient supply
    3: different gnome
    3: different level
    4: max level
    5: amount it to small
    6: gnome does not exists,
    7: gnome cool down
    8: only owner can do this action
 */

interface IRandom {
    function getRandomNumber() external returns (uint);
}

interface IGnomesTemplates is ISharedStructs {

    function getGnomeTemplateRarityAndRandom(uint rarity, uint randomNumber) external view returns (structGnome memory);

    function getCollectionPowerMultiple(uint8 level) external pure returns (uint32);

    function getCollectionById(uint id) external view returns (uint[] memory);

    function getGnomePowerByLevel(uint power, uint8 level) external view returns (uint);
}

contract MyMiniMiners is ERC721, Security, ReentrancyGuard, ISharedStructs {


    uint private _gnomePrice = 1 ether;
    uint private _feesAccountCat = 5000; //100=1%;


    /*
     [0] =  legendarySupplyLeft
     [1] =  EpicSupplyLeft
     [2] =  rareSupplyLeft
     [3] =  CommonSupplyLeft
    */

    uint32[4] private _supplyLeft = [102400, 102400, 102405, 102400];

    /*
        player => collection id => gnome id => token id
    */
    mapping(address => mapping(uint => mapping(uint => uint))) private _playerCollections;
    /*
        player => collection id => collection power
    */
    mapping(address => mapping(uint => uint)) private _playerCollectionsPower;
    /*
        player => power
    */
    mapping(address => uint) private _playerTotalPower;

    uint private _allPlayersPower;

    /* avg block time is 2 sec so on avg its will take 25 cool down 1 hour more then the daily claim*/
    uint private _numberOfBlocksToWaitBetweenTransfer = 30 * 60 * 25;

    string private _baseURIStr;

    address private _rewardsContract;
    structPlayerGnome[] private _playersGnomes;
    IRandom private _randomContract;
    IGnomesTemplates private _gnomesTemplatesContract;

    event PowerChange(address indexed player, uint collection, uint collectionPower, uint playerPower);
    event CollectionChange(address indexed player, uint collection, uint indexed oldTokenId, uint indexed newTokenId);
    event Mint(address indexed player, uint  indexed tokenId, uint collection, uint8 gnomeId, uint8 level, uint8 rarity, uint power);

    constructor(address feesAccount, address adminAccount, address randomContract, address gnomesTemplatesContract)   ERC721("My Mini Miners", "MYMM") ReentrancyGuard() payable {
        setFeesAccount(feesAccount);
        setAdminAccount(adminAccount);
        setGnomesTemplateContractAddress(gnomesTemplatesContract);
        setRandomContractAddress(randomContract);
        //solidity default value for uint is 0 so we start the tokenIds from 1
        _playersGnomes.push();
    }
    //********************************* game functions *************************************//

    function buyGnome(uint8 amountToBuy) external payable nonReentrant {
        require(msg.value == _gnomePrice * amountToBuy, "1");
        uint currentTotalSupply = totalSupply();
        require(currentTotalSupply >= amountToBuy, "2");

        uint feesAccountCat = (msg.value * _feesAccountCat / (10 ** 4));
        payable(feesAccount()).transfer(feesAccountCat);
        payable(_rewardsContract).transfer(msg.value - feesAccountCat);

        for (uint8 i; i < amountToBuy; i++) {
            uint randomNumber = _randomContract.getRandomNumber();
            uint randomPosition = randomNumber % currentTotalSupply;
            uint rarityIndex = _getRarityByPosition(randomPosition);
            _supplyLeft[rarityIndex]--;
            _increaseSupplyByIndex(rarityIndex);
            structGnome memory gnome = _gnomesTemplatesContract.getGnomeTemplateRarityAndRandom(rarityIndex, randomNumber);
            _createGnome(gnome.id, 1, gnome.rarity, gnome.collection, gnome.power);
        }
    }

    function mergeGnomes(uint tokenId1, uint tokenId2) external nonReentrant {

        require(_msgSender() == ownerOf(tokenId1) && _msgSender() == ownerOf(tokenId2), "8");
        require(_playersGnomes[tokenId1].exists && _playersGnomes[tokenId2].exists, "6");
        require(_playersGnomes[tokenId1].gnomeId == _playersGnomes[tokenId2].gnomeId, "3");
        require(_playersGnomes[tokenId1].level == _playersGnomes[tokenId2].level, "4");
        require(_playersGnomes[tokenId1].level < 10, "5");

        uint8 newLevel = _playersGnomes[tokenId1].level + 1;

        _burn(tokenId1);
        _burn(tokenId2);

        _createGnome(
            _playersGnomes[tokenId1].gnomeId,
            newLevel,
            _playersGnomes[tokenId1].rarity,
            _playersGnomes[tokenId1].collection,
            _gnomesTemplatesContract.getGnomePowerByLevel(_playersGnomes[tokenId1].power, newLevel)
        );


    }

    function addGnomeToCollection(uint tokenId) public {
        require(ownerOf(tokenId) == _msgSender(), "8");
        require(_playersGnomes[tokenId].exists, "6");
        require(_playersGnomes[tokenId].canBeUsedFromBlock <= block.number, "7");

        uint oldTokenId = _playerCollections[_msgSender()][_playersGnomes[tokenId].collection][_playersGnomes[tokenId].gnomeId];
        _playerCollections[_msgSender()][_playersGnomes[tokenId].collection][_playersGnomes[tokenId].gnomeId] = tokenId;
        _changePlayerPowerAfterChangeInCollection(_playersGnomes[tokenId].collection, _msgSender());
        emit CollectionChange(_msgSender(), _playersGnomes[tokenId].collection, oldTokenId, tokenId);
    }

    function getGnomePrice() external view returns (uint) {
        return _gnomePrice;
    }

    function getPlayerPower(address player) external view returns (uint) {
        return _playerTotalPower[player];
    }
    //
    //    function getPlayerCollectionPower(address player, uint collection) external view returns (uint) {
    //        return _playerCollectionsPower[player][collection];
    //    }

    function getPlayerCollection(address player, uint collection, uint gnomeId) external view returns (uint) {
        return _playerCollections[player][collection][gnomeId];
    }

    function getGnome(uint tokenId) external view returns (uint8, uint8, uint8, uint, uint, uint, bool) {
        require(_playersGnomes[tokenId].exists);
        return (_playersGnomes[tokenId].gnomeId, _playersGnomes[tokenId].level, _playersGnomes[tokenId].rarity, _playersGnomes[tokenId].collection, _playersGnomes[tokenId].power, _playersGnomes[tokenId].canBeUsedFromBlock, _playersGnomes[tokenId].exists);
    }

    function getTotalPower() external view returns (uint){
        return _allPlayersPower;

    }

    function _createGnome(uint8 gnomeId, uint8 level, uint8 rarity, uint collection, uint256 power) private {
        uint newTokenId = _playersGnomes.length;
        _safeMint(_msgSender(), newTokenId);
        structPlayerGnome memory playerGnome = structPlayerGnome({
        gnomeId : gnomeId,
        tokenId : newTokenId,
        canBeUsedFromBlock : 0,
        level : level,
        rarity : rarity,
        collection : collection,
        power : power,
        exists : true
        });
        _playersGnomes.push(playerGnome);
        if (_playersGnomes[_playerCollections[_msgSender()][collection][gnomeId]].level < level) {
            addGnomeToCollection(newTokenId);
        }
        emit Mint(_msgSender(), newTokenId, playerGnome.collection, playerGnome.gnomeId, playerGnome.level, playerGnome.rarity, playerGnome.power);
    }

    function _increaseSupplyByIndex(uint supplyIndex) private {
        if (supplyIndex == 0) {
            _supplyLeft[1] += 4;
        }
        if (supplyIndex == 1) {
            _supplyLeft[2] += 6;
        }
        if (supplyIndex == 2) {
            _supplyLeft[3] += 2;
        }
    }

    function _getRarityByPosition(uint position) private view returns (uint8){

        uint supply;
        //length 3 = _supplyLeft.length -1
        for (uint8 i = 3; i >= 0; i--) {
            supply = supply + _supplyLeft[i];
            if (supply >= position) {
                return i;
            }
        }
        revert("2");
    }

    function totalSupply() public view returns (uint supply){
        for (uint8 i; i <  _supplyLeft.length; i++) {
            supply = supply + _supplyLeft[i];
        }
        return supply;
    }

    function _transfer(address from, address to, uint tokenId) internal override {
        _removeGnomeFromCollection(tokenId, from);
        ERC721._transfer(from, to, tokenId);
        structPlayerGnome storage playerGnome = _playersGnomes[tokenId];
        playerGnome.canBeUsedFromBlock = block.number + _numberOfBlocksToWaitBetweenTransfer;

    }

    function _burn(uint256 tokenId) internal override {
        _removeGnomeFromCollection(tokenId, _msgSender());
        ERC721._burn(tokenId);
        _playersGnomes[tokenId].exists = false;
    }

    function _removeGnomeFromCollection(uint tokenId, address player) private {

        if (_playerCollections[player][_playersGnomes[tokenId].collection][_playersGnomes[tokenId].gnomeId] == tokenId) {
            _playerCollections[player][_playersGnomes[tokenId].collection][_playersGnomes[tokenId].gnomeId] = 0;
            _changePlayerPowerAfterChangeInCollection(_playersGnomes[tokenId].collection, player);
            emit CollectionChange(_msgSender(), _playersGnomes[tokenId].collection, tokenId, 0);
        }
    }

    function _changePlayerPowerAfterChangeInCollection(uint gnomeCollection, address player) private {
        uint[] memory collection = _gnomesTemplatesContract.getCollectionById(gnomeCollection);
        uint collectionLength = collection.length;
        uint8 lowestGnomeLevel;
        uint newPower;
        uint8 totalGnomesInCollection;
        for (uint8 i; i < collectionLength; i++) {
            uint collectionGnomeTokenId = _playerCollections[player][gnomeCollection][collection[i]];
            if (_playersGnomes[collectionGnomeTokenId].exists) {
                newPower += _playersGnomes[collectionGnomeTokenId].power;
                totalGnomesInCollection += 1;
                if (lowestGnomeLevel < _playersGnomes[collectionGnomeTokenId].level) {
                    lowestGnomeLevel = _playersGnomes[collectionGnomeTokenId].level;
                }
            }
        }
        if (collectionLength == totalGnomesInCollection) {
            newPower = newPower * _gnomesTemplatesContract.getCollectionPowerMultiple(lowestGnomeLevel);
        }

        uint oldPower = _playerCollectionsPower[player][gnomeCollection];
        _playerCollectionsPower[player][gnomeCollection] = newPower;
        _playerTotalPower[player] = _playerTotalPower[player] - oldPower + newPower;
        _allPlayersPower = _allPlayersPower - oldPower + newPower;

        emit PowerChange(player, gnomeCollection, newPower, _playerTotalPower[player]);
    }

    function _baseURI() internal view override returns (string memory) {
        return _baseURIStr;
    }

    /*
        getting paid from other contracts
    */
    receive() external payable {
        payable(_rewardsContract).transfer(msg.value);
    }
    //********************************* management functions *************************************//

    function setGnomePrice(uint price) external onlyAdmin {
        require(price > 1 ether / 2, "1");
        _gnomePrice = price;
    }

    function setNumberOfBlocksToWaitBetweenTransfer(uint blocks) external onlyAdmin {
        require(blocks > 30 * 60);
        _numberOfBlocksToWaitBetweenTransfer = blocks;
    }

    function setBaseUri(string calldata uri) external onlyAdmin {
        _baseURIStr = uri;
    }

    function setRandomContractAddress(address randomContract) public onlyAdmin {
        _randomContract = IRandom(randomContract);
    }

    function setRewardsContractAddress(address rewardsContract) public onlyAdmin {
        _rewardsContract = rewardsContract;
    }

    function setGnomesTemplateContractAddress(address gnomesTemplatesContract) public onlyAdmin {
        _gnomesTemplatesContract = IGnomesTemplates(gnomesTemplatesContract);
    }


}
